import React, {Component} from 'react';
import {Button, Col, Container, Row} from "react-bootstrap";

class Main extends Component {
    render() {
        return (
            <div className={'Volunteers container-fluid'}>
                <Row>
                    <h1>Hello</h1>
                </Row>
            </div>
        );
    }
}

export default Main;
